            <div className="container">
                <h2>Our Services</h2>
                <div id="office-cleaning">
                    <h3>Office Cleaning</h3>
                    <p>Our office cleaning services ensure your workspace is clean and welcoming.</p>
                </div>
                <div id="school-cleaning">
